REPLACE INTO `retrospective_entries` (`id`, `entry_text`, `key_point`, `line_number`, `retrospective_id`) VALUES
	(97, 'Only 1 promo payment on Friday. We\'re improving on the promo payments which I think is a good win!', b'1', 1, 20),
	(98, 'Issue this week was forcing trades. I keep entering the market because I think I see something but I\'m really just convincing myself of something that isn\'t there. I end to be okay with the idea that I might not enter the market for a whole day.', b'0', 2, 20),
	(99, 'Re-entering immediately after a losing position is a low probability play and I should avoid doing it. I\'ve been having issues with consecutive compound losses.', b'0', 3, 20),
	(100, 'My rules work and are generating profits. I just need to continue sticking to them. ', b'0', 4, 20),
	(101, 'Stick to your rules and plan, they will bring us to the end of the road!', b'1', 5, 20),
	(107, 'Emotional week where I was over-trading. The good news is that I have the skill ti trade and play this game. I have good technical analysis. I need to focus on using the areas of value to guide my entries.', b'0', 1, 16),
	(108, 'Need to focus on my take profit levels. I shouldn\'t be aiming for the starts. The stops have helped me, now let\'s work on my targets.', b'0', 2, 16),
	(109, 'My skill continues to grow. I can do this. I just to need remember my rules and plan.', b'0', 3, 16),
	(110, 'Discipline needs to be maintained by focusing on my rules and plan!', b'1', 4, 16),
	(111, 'This week I displayed great skill at finding nice and lucrative trades. I\'m proud that my technical education is bearing fruit so I should take that as a big positive.', b'0', 1, 15),
	(112, 'My mental game needs some work. I have books that should help but I need to work on my patience. Another big one is to stop worrying about the money and the future. I can\'t get there if I don\'t perform and focus on now.', b'0', 2, 15),
	(113, 'This coming week I will focus on a good mental game and improve my ability to pick directions. Let\'s get it.', b'0', 3, 15),
	(114, 'Mental game needs work, focus on the now not the future. Don\'t get caught up with money and numerical amounts', b'1', 4, 15),
	(115, 'Overall the week was good since I maintained my goals. I\'m showing good skill at making nice trades. I should be proud of that', b'0', 1, 4),
	(116, 'My losses are too big. I need to enter each trade with hard-coded stop losses. Had I kept my losses smaller I\'d hit my targets sooner and stay out of the market faster.', b'0', 2, 4),
	(117, 'Good entries and exits, need to work on stops and I\'ll be in good shape. Looking forward to next week.', b'0', 3, 4),
	(118, 'Focus on better stop losses on each trade, reduce the size of my losses!', b'1', 4, 4),
	(119, 'Finished the week with nice profits but I did ignore some losses. Making the switch to trade only with-trend was a great decision. It kept me on the right side of the market.', b'0', 1, 3),
	(120, 'My entries were in the right direction but too early. The drawdowns are too high. I need to be more selective and quicker to exit.', b'0', 2, 3),
	(121, 'I need to set up better trades with protective stops. My losses are too high. I should follow my rules of only entering on highs and lows of candles', b'0', 3, 3),
	(122, 'Overall good first week, looking forward to the next week. Need to keep my head in the game and better time my entries. I can do this', b'0', 4, 3),
	(123, 'Losses too high. Need protective stops.', b'1', 5, 3),
	(124, 'Difficult week emotionally. Some big bull trend days but I kept going counter-trend expecting the big dump. This isn\'t a sustainable way of trading. Wasn\'t following my rules and I payed the price for it.', b'0', 1, 18),
	(125, 'Show nice skill to dig myself out of big holes. This indicates that I have the skill to win at this game. I need to focus on accepting the always-in direction and to not aim for big dumps. My trades need to aim for small, consistent gains and not Hail Mary\'s!!!', b'0', 2, 18),
	(126, 'Need to be more impartial to market direction. Stay with the trend. 25 EMA will protect me.', b'0', 3, 18),
	(127, 'Focus on reading the chart for what it is and not what I think it will be. The answer is always in front of me', b'1', 4, 18),
	(128, '* 2 days were write-offs and Monday was a holiday: Labor Day', b'1', 5, 18),
	(129, 'Start of a new month where I was supposed to go live, I\'m glad I didn\'t. I\'m still not taking it seriously enough. Still predicting too much and not enough reacting. I\'m getting distracted by outside noise.', b'0', 1, 17),
	(130, 'I have the skill to get in on the big moves, just need to improve my entries. Higher lot sizes with some volatility mean that I need to focus on good entries. I\'ve lost a few on tight stops.', b'0', 2, 17),
	(131, 'The promo payments need to stop, they\'re not sustainable. It\'s a sign that I\'m not taking it seriously. Enter with stops and we\'ll cut them out', b'0', 3, 17),
	(132, 'Take paper trading more seriously!', b'1', 4, 17),
	(133, 'Reduce promo payments, they\'re not going to be there during go-live', b'1', 5, 17),
	(134, 'This week I showed new skills of multi-trading. I need to lower my position sizes. Choppy markets kill me with full position sizing.', b'0', 1, 21),
	(135, 'Getting very tilted and posting consecutive losses because I can\'t handle being wrong. I need to lower my position sizes to reduce emotion and tilt and look for multi-entries.', b'0', 2, 21),
	(136, 'Stick to the always-in direction and trade near areas of value. Smaller position sizes and accept that I can and will be wrong', b'0', 3, 21),
	(137, 'I need to stop being in a rush. I force trades because I\'m impatient and want to be finished.', b'0', 4, 21),
	(138, 'I tend to focus on numerical profit amounts and miss take profits because I push them too far to make up for previous losses. I am over-trading and need to relax. Lower my position size! It will make me more profitable', b'0', 5, 21),
	(139, 'Lower position sizes !!', b'1', 6, 21),
	(140, 'I wrote off 1 day for emotional instability. I am confident of my ability to handle myself better moving forward.', b'1', 7, 21),
	(141, 'Overall strong week for trading. When following my structured approached I tend to have the most success. Need to focus on keeping things mechanical', b'0', 1, 22),
	(142, 'Emotions will creep up, need to focus on my technique and technical skills to keep me grounded and focus on what the chart is telling me and not what I think / want it to tell me', b'0', 2, 22),
	(143, 'Not much to say about this week overall. Small position sizes continue to be very important', b'0', 3, 22),
	(144, 'Small position sizes coupled with levels & zones will keep the gains consistent', b'1', 4, 22),
	(145, 'Very difficult trading week which was unfortunate considering the prior week was a strong one. I was unstable emotionally, probably creeped in from my personal life during the weekend.', b'0', 1, 23),
	(146, 'Confidence has been shaky. I don\'t feel like I even have a strategy, sort of feel lost and insecure about what I\'m doing.', b'0', 2, 23),
	(147, 'Had some discipline issues this week, not following my rules. Probably a result of my lack of confidence.', b'0', 3, 23),
	(148, 'Need to be up and awake before the market opens. Have to prioritize pre & post-market routines', b'0', 4, 23),
	(149, 'Struggled with emotional consistency and discipline. Lacked confidence with my strategy', b'1', 5, 23),
	(150, 'Need to focus on my system that I\'ve built with my experience, celebrate my skill and accept my mistakes as areas of improvement', b'1', 6, 23),
	(151, 'I need to be better with my pre & post-market routines. Prep work is extremely important and will keep me on the right side of the market', b'1', 7, 23),
	(152, 'This was go live week! Had some good trading days, was a little nervous but overall I performed very well. Small position sizes was a great call', b'0', 1, 24),
	(153, 'I need to focus on following my regular strategy and not leaning too heavily on things I\'m not used to like RSI. I should use it to support my ideas and not rely on it', b'0', 2, 24),
	(154, 'Friday was a dangerous trading day since I was scalping at max position size. While it was easier to make money, it could have easily backfired on me. I should focus on fewer trades, smaller position sizes and better entries', b'0', 3, 24),
	(155, 'Got a little greedy now that I\'m using real money. I should avoid trading once my target is hit because I can very easily give those profits back', b'0', 4, 24),
	(156, 'Go live was a good start. I need to focus on strategy, rules and small position sizes.', b'1', 5, 24),
	(157, 'Avoid max position scalping', b'1', 6, 24),
	(163, 'This was my toughest and overall poorest performing week. I\'m trying to do too much. I\'m putting excessive pressure on myself and am forcing trades.', b'0', 1, 27),
	(164, 'I struggle to be adaptable. I get an idea in my head and become inflexible. I\'m trying for the "big move" and don\'t know why. Perhaps I lack confidence or I\'m unsure of myself.', b'0', 2, 27),
	(165, 'I need to focus on my training. I\'ve been successful for weeks and months. I have the skill. I can do this so long as I accept what I see as the truth and nothing but the truth.', b'0', 3, 27),
	(166, 'I need to lower my position sizes and keep my targets smaller. I should not be trying to do so much in one shot. I need to relax, trust myself and keep calm. There\'s no rush or time limit', b'0', 4, 27),
	(167, 'Focus on what has been proven to work', b'1', 5, 27),
	(168, 'Don\'t rush, we have all the time in the world', b'1', 6, 27),
	(169, 'A good recovery week from the struggles of the week before. Made good calls in good directions. Was able to better stay with the trend rather than get caught up in counter-trend scalping', b'0', 1, 28),
	(170, 'I tend to start my days red which sets the pace for the rest of the day. I think that\'s key. Should be more patient and wait for the open to run its course.', b'0', 2, 28),
	(171, 'Not much else to say, keep with the trend and don\'t get lost looking for the "big move"', b'0', 3, 28),
	(172, 'The opening candles is a low-success play, avoid it', b'1', 4, 28),
	(173, 'A little all over the place this week. Showed decent skill but the max position size is continuing to be a struggle.', b'0', 1, 29),
	(174, 'Not much else to say this week other than to be more patient, not get flustered during losses and to stop revenge trading and to stop adding to losing positions', b'0', 2, 29),
	(175, 'My goal to suck less is reducing trades per candle and to slow myself down and wait for more confirmations', b'0', 3, 29),
	(176, 'Slow and steady wins the race', b'1', 4, 29),
	(177, 'Patience and fewer trades per candle will keep losses smaller and manageable', b'1', 5, 29),
	(178, 'A better week, put together some nice trading days with good patience and entries.', b'0', 1, 30),
	(179, 'Had 2 small red days at the end. I think its important o embrace these red days. Sometimes I can\'t make the target and I need to be okay with that. I put too much pressure on myself and I\'m always in a rush. I need to slowdown and take it day by day', b'0', 2, 30),
	(180, 'Need to work on my opens. I\'m often putting myself in a hole early on and spend the rest of the day fighting back. I have the skill to make money during the day, I just need better starts and opens to make it easier on myself.', b'0', 3, 30),
	(181, 'Embrace the red days, you need to learn to slow down and accept what the market gives you', b'1', 4, 30),
	(182, 'Need to be better on the opens. Either be more patient or lower that position size', b'1', 5, 30),
	(183, 'Controlling my losses and not gambling on the opening candle has helped immensely. My psych feels stronger and more well-rounded.', b'0', 1, 31),
	(184, 'I need to work on my opens. I am consistently losing the first 2-3 trades and I should work on this. Either smaller position sizes or more patience', b'0', 2, 31),
	(185, 'I should focus on more accurate and meaningful take profit levels and I should stop placing them randomly', b'0', 3, 31),
	(186, 'Need to improve my opens (this is a recurring theme)', b'1', 4, 31),
	(187, 'Aim for meaningful take profit levels', b'1', 5, 31),
	(188, 'Not a good week. Overtrading and lacking conviction on my trades. Scalping positions that are way too small which means my profits aren\'t large enough and losses are too big', b'0', 1, 32),
	(189, 'I continue to struggle to be on the right side of the market. I need to stop trading for 1 candle and trade for the next 3-4', b'0', 2, 32),
	(190, 'Read the chart and create a hypothesis so I can better gauge overall market structure', b'0', 3, 32),
	(191, 'Quick scalps at max position size is not a viable strategy. I\'m losing too much with stops that are too small', b'1', 4, 32),
	(192, 'Not a good week but a necessary one. Finally got burned badly enough from max position scalping with small stops that are not appropriate for the Nasdaq. ', b'0', 1, 33),
	(193, 'Learned to focus on small position sizes. My lack of trading the right way was finally exposed. As much as I hated it, I needed this reality check', b'0', 2, 33),
	(194, 'I need to focus on trading the right way and to stop spending most of my trading day in the red', b'0', 3, 33),
	(195, 'Trade the right way, small sizes and appropriate stops', b'1', 4, 33),
	(196, 'Don\'t pressure myself with hard goals and time-sensitive profit. Take it day by day and build the account one step at a time', b'1', 5, 33),
	(197, 'The switch to 1/2 position size has been an excellent decision and has allowed me to develop sustainable trading habits. I need to remain disciplined and not go above this position size', b'0', 1, 34),
	(198, 'Need to work on my bad habit of trading immediately after a win. I often lose. It\'s the same as immediately entering after losing a trade. Once the trade completes, wait for a new opportunity.', b'0', 2, 34),
	(199, 'Avoid trading volatile candles. Simple as that. I will lose. It is never worth it', b'1', 3, 34),
	(200, 'I need to work on increasing my average win. They\'re too small and need to increase my R:R to 2:1. I\'m too close to 1:1 and am relying on my win percentage to remain profitable', b'0', 4, 34),
	(201, 'Remain disciplined with 1/2 position sizes', b'1', 5, 34),
	(202, 'Focus on letting winning trades run, I need to increase my average win size', b'1', 6, 34),
	(203, 'My worst week in a while. Need to know when to call it quits. Emotionally unstable and just poor entries. I have difficulty changing my mind. I continually force trades in the wrong direction', b'0', 1, 35),
	(204, 'Not much else to say, just poor performance and demoralization', b'0', 2, 35),
	(205, 'I need to be better. I want to be better, I need to double down and put in more meaningful work', b'1', 3, 35),
	(206, 'Hit rock bottom. I am going to blow my account if I don\'t fix my bad mistakes', b'0', 1, 36),
	(207, 'Started tracking my unacceptable mistakes which is going to help me keep my head straight', b'0', 2, 36),
	(208, 'Developing a new routine of printing my charts after each day and analyzing them before the start of the next trading day', b'0', 3, 36),
	(209, 'I will develop myself into a trader', b'0', 4, 36),
	(210, 'Do not give up.', b'1', 5, 36),
	(211, 'Started my routine. Excited to get it going. Going to follow a leveling system that will allow me to develop the right to trade bigger. Every 100 points I will move up 0.1 in lot size.', b'0', 1, 37),
	(212, 'The week was okay. Had 2 good days and 1 bad mistake day. If I would have cleaned up my bad mistakes each of these days would have been 30+ point days. This needs to be my top priority', b'0', 2, 37),
	(213, 'Follow the routine. No ifs or buts', b'1', 3, 37),
	(214, 'Clean up those bad mistakes. They are costing you your profitability', b'1', 4, 37),
	(215, 'I tend to have the best days when my trades number between 5 & 12. I should focus on reducing the number of trades taken in a day', b'0', 3, 37);
